о е избран методот за преземање „Force Downloads“ или „X-Accel-Redirect/X-Sendfile“, но не работи, системот ќе го користи методот „Само пренасочување (небезбедно)“ како последно средство. <a href="%1$s">Погледнете го ова упатство</a> за повеќе детали.','Allow using redirect mode (insecure) as a last resort'=>'Дозволете користење на режимот за пренасочување (небезбедно) како последно средство','Task Options'=>'Опции за задачи','Set your store location and where you\'ll ship to.'=>'Поставете ја локацијата на вашата продавница и каде ќе испраќате.','Choose payment providers and enable payment methods at checkout.'=>'Изберете провајдери на плаќање и овозможете начини на плаќање при наплатата.','Start by adding the first product to your store. You can add your products manually, via CSV, or import them from another service.'=>'Започнете со додавање на првиот продукт во вашата продавница. Можете да ги додавате вашите продукти рачно, преку CSV или да ги увезете од друга услуга.','Your store address is required to set the origin country for shipping, currencies, and payment options.'=>'Потребна е адресата на вашата продавница за да се постави земјата на потекло за испорака, валути и опции за плаќање.','Set your store location and configure tax rate settings.'=>'Поставете ја локацијата на продавницата и конфигурирајте ги поставките за даночна стапка.','Grow your store'=>'Растете ја вашата продавница','The rate at which tax is applied.'=>'Стапката по која се применува данокот.','Notes are unavailable because the "admin-note" data store cannot be loaded.'=>'Белешките се недостапни бидејќи складиштето на податоци „admin-note“ не може да се вчита.','Get backups'=>'Добијте резервни копии','Store downtime means lost sales. One-click restores get you back online quickly if something goes wrong.'=>'Застојот на продавницата значи изгубена продажба. Обновувањата со еден клик ве враќаат брзо на интернет ако нешто тргне наопаку.','Protect your WooCommerce Store with Jetpack Backup.'=>'З