n discounts have been applied).'=>'Вкупно линија (цената на продуктот по примена на купонските попусти).','Line subtotal (the price of the product before coupon discounts have been applied).'=>'Подвкуп на линија (цената на продуктот пред да се примени купонските попусти).','Item total amounts provided using the smallest unit of the currency.'=>'Вкупните износи на ставките се обезбедени со користење на најмалата единица на валутата.','Decimal precision of the returned prices.'=>'Децимална прецизност на вратените цени.','Raw unrounded product prices used in calculations. Provided using a higher unit of precision than the currency.'=>'Необработени цени на продуктите што се користат во пресметките. Обезбедено со користење на повисока единица на прецизност од валутата.','Price data for the product in the current line item, including or excluding taxes based on the "display prices during cart and checkout" setting. Provided using the smallest unit of the currency.'=>'Податоци за цените на продуктот во тековната линија, вклучително или без даноци врз основа на поставката „прикажи цени за време на кошничката и наплатата“. Обезбедено со користење на најмалата единица на валутата.','If true, only one item of this product is allowed for purchase in a single order.'=>'Ако е точно, само една ставка од овој продукт е дозволена за купување по една нарачка.','True if backorders are allowed past stock availability.'=>'Точно ако се дозволени задни нарачки во минатото достапност на акции.','Line subtotal tax.'=>'Линиски субвкупен данок.','Category image.'=>'Слика за категорија.','Name of the package.'=>'Име на пакетот.','Shipping destination address.'=>'Крајна адреса на доставување.','Current set shipping address for the customer.'=>'Тековна поставена адреса на доставување на купувачот.','List of available shipping rates for the cart.'=>'Список на достапни цени за доставување за кошничката.','Name of the item.'=>'Име на ставката.','ID of the shipping method that provided the rate.'=>'