ата во кошничката повеќе не постои или е неважечка.','Unique identifier (key) for the cart item.'=>'Единствен идентификатор (клуч) за ставката во кошничката.','Limit result set to reviews from specific product IDs.'=>'Ограничете го поставениот резултат на рецензии од специфични ID на продукти.','Limit result set to reviews from specific category IDs.'=>'Ограничете го поставениот резултат на рецензии од ID-и на одредени категории.','Coupon cannot be removed because it is not already applied to the cart.'=>'Купонот не може да се отстрани бидејќи веќе не е аплициран во кошничката.','Invalid coupon code.'=>'Неважечки купонски код.','New quantity of the item in the cart.'=>'Нова количина на артикл во кошничката.','Unique identifier (key) for the cart item to update.'=>'Единствен идентификатор (клуч) за ажурирање на ставката во кошничката.','The %s payment gateway is not available.'=>'Портата за плаќање %s не е достапна.','No payment method provided.'=>'Не е обезбеден начин на плаќање.','Invalid payment result received from payment method.'=>'Неважечки резултат на плаќање добиен од начинот на плаќање.','Data to pass through to the payment method when processing payment.'=>'Податоци што треба да се пренесат до начинот на плаќање при обработката на плаќањето.','Limit result set to products based on a maximum price, provided using the smallest unit of the currency.'=>'Ограничете го поставениот резултат на продукти врз основа на максимална цена, обезбедени со користење на најмалата единица на валутата.','Limit result set to products based on a minimum price, provided using the smallest unit of the currency.'=>'Ограничете го поставениот резултат на продукти врз основа на минимална цена, обезбедена со користење на најмалата единица на валутата.','Coupon does not exist in the cart.'=>'Купонот не постои во кошничката.','Unique identifier for the coupon within the cart.'=>'Единствен идентификатор за купонот во кошничката.','Coupons are disabled.'=>'Купоните се оневозможени.','The 