лоните','Invalid category ID.'=>'Неважечки ID на категорија.','Maximum number of items to be returned in result set. Defaults to no limit if left blank.'=>'Максимален број на ставки што треба да се вратат во комплетот резултати. Стандардно е без ограничување ако се остави празно.','WooCommerce %1$s table creation failed. Does the %2$s user have CREATE privileges on the %3$s database?'=>'Не успеа да се создаде табела %1$s на WooCommerce. Дали корисникот %2$s има CREATE привилегии на базата на податоци %3$s?','Collect and validate EU VAT numbers at checkout'=>'Соберете и потврдете ги ДДВ броевите на ЕУ при наплата','Get real-time order alerts anywhere'=>'Добијте предупредувања за нарачки во реално време каде било','Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.'=>'Добивајте известувања за активноста на продавницата, вклучувајќи нови нарачки и прегледи на продукти директно на вашите мобилни уреди со апликацијата Woo.','If your store is based in the EU, we recommend using the EU VAT Number extension in addition to automated taxes. It provides your checkout with a field to collect and validate a customer\'s EU VAT number, if they have one.'=>'Ако вашата продавница е со седиште во ЕУ, препорачуваме да ја користите екстензијата за ДДВ на ЕУ како додаток на автоматизираните даноци. На вашата наплата му дава поле за собирање и потврдување на ЕУ ДДВ-бројот на клиентот, доколку го има.','First order received'=>'Првата нарачка е примена','The admin note layout has a wrong prop value.'=>'Распоредот на административната белешка има погрешна вредност на потпората.','This video tutorial will help you go through the process of adding your first product in WooCommerce.'=>'Овој видео туторијал ќе ви помогне да поминете низ процесот на додавање на вашиот прв продукт во WooCommerce.','Do you need help with adding your first product?'=>'Дали ви треба помош за додавање на вашиот прв продукт?','Start your online clothing store'=>'Започнете ја вашата онлајн продавница за облека','Starting a fashion website is exciting but it may seem overwhelming as well. In this article, we\'ll walk you through the setup process, teach you to create successful product listings, and show you how to market to your ideal audience.'=>'Отворањето модна веб-страница е возбудливо, но може да изгледа и огромно. Во оваа статија, ќе ве водиме низ процесот на поставување, ќе ве научиме да креирате успешни огласи за продукти и ќе ви покажеме како да ѝ пазарите на вашата идеална публика.','Share feedback'=>'Споделете повратни информации','Now that you’ve chosen us as a partner, our goal is to make sure we\'re providing the right tools to meet your needs. We\'re looking forward to having your feedback on the store setup experience so we can improve it in the future.'=>'Сега кога не избравте за партнер, нашата цел е да се погрижиме да ги обезбедиме вистинските алатки за да ги задоволиме вашите потреби. Со нетрпение очекуваме да ги имаме вашите повратни информации за искуството за поставување продавница за да можеме да го подобриме во иднина.','Watch tutorial'=>'Гледајте туторијал','Changing eCommerce platforms might seem like a big hurdle to overcome, but it is easier than you might think to move your products, customers, and orders to WooCommerce. This article will help you with going through this process.'=>'Промената на платформите за е-трговија може да изгледа како голема пречка што треба да се надмине, но полесно е отколку што мислите да ги преместите вашите продукти, клиенти и нарачки во WooCommerce. Оваа статија ќе ви помогне да поминете низ овој процес.','WooCommerce Subscriptions allows you to introduce a variety of subscriptions for physical or virtual products and services. Create product-of-the-month clubs, weekly service subscriptions or even yearly software billing packages. Add sign-up fees, offer free trials, or set expiration periods.'=>'WooCommerce Subscriptions ви овозможува да воведете различни претплати за физички или виртуелни продукти и услуги. Креирајте клубови за продукт на месецот, неделни претплати за услуги или дури и годишни софтверски пакети за наплата. Додадете надоместоци за пријавување, понудете бесплатни проби или поставете периоди на истекување.','Do you want to migrate from Shopify to WooCommerce?'=>'Дали сакате да мигрирате од Shopify на WooCommerce?','Views'=>'Прегледи','Visitors'=>'Посетители','West Pokot'=>'Западен Покот','Wajir'=>'Ваџир','Vihiga'=>'Вихига','Uasin Gishu'=>'Уасин Гишу','Turkana'=>'Туркана','Trans Nzoia'=>'Транс Нзоја','Tharaka-Nithi'=>'Тарака-Нити','Tana River'=>'Реката Тана','Taita-Taveta'=>'Таита-Тавета','Siaya'=>'Сијаја','Samburu'=>'Самбуру','Nyeri'=>'Ниери','Nyandarua'=>'Нјандаруа','Nyamira'=>'Нјамира','Narok'=>'Нарок','Nandi'=>'Нанди','Nakuru'=>'Накуру','Nairobi County'=>'Округот Најроби','Murang’a'=>'Муранга','Mombasa'=>'Момбаса','Migori'=>'Мигори','Meru'=>'Меру','Marsabit'=>'Марсабит','Mandera'=>'Мандера','Makueni'=>'Макуени','Machakos'=>'Мачакос','Lamu'=>'Ламу','Laikipia'=>'Лаикипија','Kwale'=>'Квале','Kitui'=>'Китуи','Kisumu'=>'Кисуму','Kisii'=>'Кисии','Kirinyaga'=>'Кирињага','Kilifi'=>'Килифи','Kiambu'=>'Киамбу','Kericho'=>'Керичо','Kakamega'=>'Какамега','Kajiado'=>'Каџиадо','Isiolo'=>'Исиоло','Homa Bay'=>'Заливот Хома','Garissa'=>'Гариса','Embu'=>'Ембу','Elgeyo-Marakwet'=>'Елгејо-Мараквет','Bungoma'=>'Бунгома','Bomet'=>'Бомет','Baringo'=>'Баринго','One or more tables required for WooCommerce to function are missing, some features may not work as expected. Missing tables: %1$s.'=>'Недостасуваат една или повеќе табели потребни за функционирање на WooCommerce, некои функции може да не работат како што се очекуа. Недостасуваат табели: %1$s.','Start using new features that are being progressively rolled out to improve the store management experience.'=>'Започнете да користите нови функции кои постепено се шират за да го подобрите искуството за управување со продавницата.','Features'=>'Карактеристики