 functionality may not work as expected.'=>'Недостасуваат основни табели: %s. Некои функционалности на WooCommerce може да не работат како што се очекува.','Take payments with the provider that’s right for you - choose from 100+ payment gateways for WooCommerce.'=>'Преземете плаќања со провајдерот што е вистински за вас - изберете од 100+ портали за плаќање за WooCommerce.','Home'=>'Дома','Overview'=>'Преглед','Marketplace'=>'Пазар','Install plugins'=>'Инсталирај додатоци','Uh oh... There was a problem during the Jetpack and WooCommerce Shipping & Tax install. Please try again.'=>'Уф... Имаше проблем при инсталирањето на Jetpack и WooCommerce Shipping & Tax. Ве молиме обидете се повторно.','We noticed that there was a problem during the Jetpack and WooCommerce Shipping & Tax install. Please try again and enjoy all the advantages of having the plugins connected to your store! Sorry for the inconvenience. The "Jetpack" and "WooCommerce Shipping & Tax" plugins will be installed & activated for free.'=>'Забележавме дека имаше проблем при инсталирањето на Jetpack и WooCommerce Shipping & Tax. Обидете се повторно и уживајте во сите предности на приклучоците поврзани со вашата продавница! Извинете за непријатностите. Приклучоците „Jetpack“ и „WooCommerce Shipping & Tax“ ќе се инсталираат и активираат бесплатно.','Start accepting payments on your store!'=>'Почнете да прифаќате плаќања во вашата продавница!','North East'=>'Североисток','Savannah'=>'Савана','Cabo Delgado'=>'Кабо Делгадо','Zambézia'=>'Замбезија','Tete'=>'Тет','Sofala'=>'Софала','Niassa'=>'Нијаса','Nampula'=>'Нампула','Maputo'=>'Мапуто','Maputo Province'=>'провинција Мапуто','Manica'=>'Маница','Inhambane'=>'Инхамбејн','Gaza'=>'Газа','Western North'=>'Западен север','Volta'=>'Волта','Upper West'=>'Горниот Запад','Upper East'=>'Горниот Исток','Oti'=>'Оти','Greater Accra'=>'Голема Акра','Bono East'=>'Боно Исток','Bono'=>'Боно','Brong-Ahafo'=>'Бронг-Ахафо','Ashanti'=>'Ашанти','Ahafo'=>'Ахафо','User&#8217;s WooCommerce payment tokens data.'=>'Податоци за токени за плаќање на корисникот WooCommerce.','User&#8217;s WooCommerce access to purchased downloads data.'=>'Пристап на корисникот WooCommerce до купените податоци за преземања.','User&#8217;s WooCommerce purchased downloads data.'=>'Купените податоци за преземања на корисникот WooCommerce.','User&#8217;s WooCommerce orders data.'=>'Податоци за нарачки на корисникот WooCommerce.','User&#8217;s WooCommerce customer data.'=>'Кориснички податоци за клиентите на WooCommerce.','%s() was called before the Action Scheduler data store was initialized'=>'%s() беше повикан пред да се иницијализира продавницата за податоци на Распоредувач на дејства','Your store\'s uploads directory is <a href="%1$s">browsable via the web</a>. We strongly recommend <a href="%2$s">configuring your web server to prevent directory indexing</a>.'=>'Директориумот за поставувања на вашата продавница може да се <a href="%1$s">прелистува преку веб</a> . Силно препорачуваме да го <a href="%2$s">конфигурирате вашиот веб-сервер за да спречите индексирање на директориуми</a> .','Finish setup'=>'Завршете го поставувањето','Take payments in cash upon delivery.'=>'Прифати плаќања при достава.','Take payments via bank transfer.'=>'Земете плаќања преку банкарски трансфер.','Coupons discounts'=>'Купон за попуст','If checked, free shipping would be available based on pre-discount order amount.'=>'Ако е означено, ќе биде достапна бесплатна испорака врз основа на износот на нарачката пред попуст.','Apply minimum order rule before coupon discount'=>'Примени правило за минимална нарачка пред попуст на купонот','WooCommerce.com support'=>'Поддршка за WooCommerce.com','Installed version not tested with active version of WooCommerce %s'=>'Инсталираната верзија не е тестирана со активната верзија на WooCommerce %s','%1$s (update to version %2$s is available)'=>'%1$s (достапно е ажурирање на верзијата %2$s)','Please visit the <a href="%s" target="_blank">subscriptions page</a> and renew to continue receiving updates.'=>'Ве молиме посетете ја <a href="%s" target="_blank">страницата за претплати</a> и обновете за да продолжите да добивате ажурирања.','Shipping Label'=>'Натпис на доставувањето','Name of other platform used to sell (not listed).'=>'Име на друга платформа што се користи за продажба (не е наведена).','Limit stats fields to the specified items.'=>'Ограничете ги полињата за статистика на наведените ставки.','The plugin could not be activated.'=>'Додатокот не може да се активира.','Personalize homepage'=>'Персонализирајте ја почетната страница','Personalize your store\'s homepage'=>'Персонализирајте ја почетната страница на вашата продавница','The homepage is one of the most important entry points in your store. When done right it can lead to higher conversions and engagement. Don\'t forget to personalize the homepage that we created for your store during the onboarding.'=>'Почетната страница е една од најважните влезни точки во вашата продавница. Кога се прави правилно, тоа може да доведе до повисоки конверзии и ангажман. Не заборавајте да ја персонализирате почетната страница што ја создадовме за вашата продавница за време на вклучувањето.','Try the new way to get paid'=>'Пробајте го новиот начин за да добиете плата','It appears one or more database tables were missing. Attempting to re-create the missing table(s).'=>'Се чини дека недостасуваат една или повеќе табели од базита на податоци. Се прави обид за повторно создавање на табелата/те што недостасуваат.','Your store is configured to serve digital products using "Redirect only" method. This method is deprecated, <a href="%s">please switch to a different method instead.</a><br><em>If you use a remote server for downloadable files (such as Google Drive, Dropbox, Amazon S3), you may optionally wish to "allow using redirects as a last resort". Enabling that and/or selecting any of the other options will make this notice go away.</em>'=>'Вашата продавница е поставена да опслужува дигитални продукти со методата „Само пренасочување“. Овој метод е застарен, <a href="%s">Ве молиме изберете некој друг метод.</a><br><em>Ако користите стран сервер за датотеки што може да се преземаат (како Google Drive, Dropbox, Amazon S3), правилниот метод ќе се искористи автоматски, па одберете која било од другите опции за да ја отстраните оваа забелешка.</em>','Get started'=>'Започни','Send targeted campaigns, recover abandoned carts and much more with Mailchimp.'=>'Испратете насочени кампањи, вратете ги напуштените колички и многу повеќе со Mailchimp.','Securely accept credit and debit cards with one low rate, no surprise fees (custom rates available). Sell online and in store and track sales and inventory in one place.'=>'Безбедно прифатете кредитни и дебитни картички со една ниска стапка, без изненадувачки надоместоци (достапни се сопствени стапки). Продавајте онлајн и во продавница и следете ја продажбата и залихите на едно место.','Choose the payment that you want, pay now, pay later or slice it. No credit card numbers, no passwords, no worries.'=>'Изберете ја исплатата што ја сакате, плаќајте сега, плаќајте подоцна или пресечете ја. Без броеви на кредитни картички, без лозинки, без грижи.','Accept debit and credit cards in 135+ currencies, methods such as Alipay, and one-touch checkout with Apple Pay.'=>'Прифатете дебитни и кредитни картички во над 135 валути, методи како Alipay и плаќање со еден допир со Apple Pay.','Average order value'=>'Просечна вредност на нарачката','Amount'=>'износ','Gross sales'=>'Бруто продажба','Customer type'=>'Тип на клиент','Select products'=>'Изберете продукти','Edit Coupon'=>'Уреди купон','Edit Order'=>'Уреди нарачка','IP address.'=>'IP адреса.','Analytics'=>'Аналитика','[deleted]'=>'[избришано]','CBD and other hemp-derived products'=>'CBD и други продукти од коноп','Current page retrieval should be called on or after the `current_screen` hook.'=>'Преземањето на тековната страница треба да се повика на или по куката за `curr