ња и пристап до поддршката.','%s subscription expired'=>'Претплатата на %s истече','Enable Autorenew'=>'Овозможете автоматско обновување','Your subscription expires in %d days. Enable autorenew to avoid losing updates and access to support.'=>'Вашата претплата истекува за %d дена. Овозможете автоматско обновување за да избегнете губење на ажурирањата и пристапот до поддршката.','%s subscription expiring soon'=>'Претплатата на %s истекува наскоро','Install Woo mobile app'=>'Инсталирајте ја мобилната апликација Woo','Install the WooCommerce mobile app to manage orders, receive sales notifications, and view key metrics — wherever you are.'=>'Инсталирајте ја мобилната апликација WooCommerce за да управувате со нарачките, да добивате известувања за продажба и да ги прегледувате клучните метрики - каде и да сте.','Review your orders'=>'Прегледајте ги вашите нарачки','Browse'=>'Прелистајте','Another order milestone! Take a look at your Orders Report to review your orders to date.'=>'Уште една пресвртница за нарачката! Погледнете го вашиот Извештај за нарачки за да ги прегледате вашите досегашни нарачки.','You\'ve hit the 10 orders milestone! Look at you go. Browse some WooCommerce success stories for inspiration.'=>'Ја достигнавте пресвртницата од 10 нарачки! Погледнете како ви оди. Прелистајте неколку успешни приказни на WooCommerce за инспирација.','Congratulations on getting your first order! Now is a great time to learn how to manage your orders.'=>'Честитки за добивањето на вашата прва нарачка! Сега е одлично време да научите како да управувате со вашите нарачки.','Congratulations on processing %s orders!'=>'Честитки за обработката на нарачките %s!','New sales record!'=>'Нов рекорд во продажба!','Woohoo, %1$s was your record day for sales! Net sales was %2$s beating the previous record of %3$s set on %4$s.'=>'Уууу, %1$s беше вашиот рекорден ден за продажба! Нето-продажбата беше %2$s, надминувајќи го претходниот рекорд од %3$s поставен на %4$s.','Activate usage tracking'=>'Активирајте го следењето на користењето','Gathering usage data allows us to improve WooCommerce. Your store will be considered as we evaluate new features, judge the quality of an update, or determine if an improvement makes sense. You can always visit the %1$sSettings%3$s and choose to stop sharing data. %2$sRead more%3$s about what data we collect.'=>'Собирањето податоци за користење ни овозможува да го подобриме WooCommerce. Вашата продавница ќе биде разгледана додека ги проценуваме новите функции, го оценуваме квалитетот на ажурирањето или одредуваме дали подобрувањето има смисла. Секогаш можете да ги посетите %1$sПоставки%3$s и да изберете да престанете да споделувате податоци. %2$sПрочитајте повеќе%3$s за тоа кои податоци ги собираме.','Add a product'=>'Додај продукт','Report table data is being deleted.'=>'Податоците од табелите за извештаи се бришат.','Report table data is being rebuilt. Please allow some time for data to fully populate.'=>'Податоците од табелата за извештаи се обновуваат. Ве молиме оставете малку време за целосно пополнување на податоците.','An import is already in progress. Please allow the previous import to complete before beginning a new one.'=>'Веќе е во тек увоз. Дозволете претходното увоз да заврши пред да започнете нов.','The admin note action label prop cannot be empty.'=>'Реквизитот на ознаката за акција за административна белешка не може да биде празен.','The admin note action name prop cannot be empty.'=>'Реквизитот за името на акцијата за административна белешка не може да биде празен.','The admin note date prop cannot be empty.'=>'Реквизитот за датум на административна белешка не може да биде празен.','The admin note source prop cannot be empty.'=>'Реквизитот за извор на административна белешка не може да биде празен.','The admin note status prop (%s) is not one of the supported statuses.'=>'Реквизитот за статус на административна белешка (%s) не е еден од поддржаните статуси.','The admin note status prop cannot be empty.