ase error.'=>'Грешка во базата на податоци.','Activity log for the action.'=>'Дневник на активности за акцијата.','ActionScheduler_Action::$args too long. To ensure the args column can be indexed, action args should not be more than %d characters when encoded as JSON.'=>'ActionScheduler_Action::$args премногу долго. За да се осигура дека колоната args може да се индексира, акционите аргови не треба да бидат повеќе од %d знаци кога се кодирани како JSON.','There was a failure scheduling the next instance of this action: %s'=>'Имаше неуспех при закажувањето на следната инстанца од оваа акција: %s','There was a failure fetching this action: %s'=>'Имаше неуспех при преземањето на оваа акција: %s','action ignored via %s'=>'акцијата е игнорирана преку %s','action failed via %1$s: %2$s'=>'акцијата не успеа преку %1$s: %2$s','action complete via %s'=>'акцијата е завршена преку %s','action started via %s'=>'акцијата започна преку %s','The next queue will begin processing in approximately %d seconds.'=>'Следниот ред ќе започне со обработка за приближно %d секунди.','A new queue has begun processing. <a href="%s">View actions in-progress &raquo;</a>'=>'Започна обработката на нова редица. <a href="%s">Прикажи дејства кои се во тек »</a>','Action [%1$s] has an invalid schedule: %2$s'=>'Акцијата [%1$s] има неважечки распоред: %2$s','Excluded report order statuses'=>'Исклучени статуси на нарачки за извештаи','Settings for WooCommerce admin reporting.'=>'Поставки за известување на администраторот на WooCommerce.','%1$s &lsaquo; %2$s'=>'%1$s ‹ %2$s','The date/time the action is/was scheduled to run.'=>'Датумот/времето кога акцијата е/беше планирано да се изврши.','Scheduled'=>'Закажано','The action\'s schedule frequency.'=>'Зачестеноста на распоредот на акцијата.','Optional action group.'=>'Факултативна акциона група.','Optional data array passed to the action hook.'=>'Изборната низа на податоци предадена на куката за акција.','Action statuses are Pending, Complete, Canceled, Failed'=>'Статусите на дејствата се во очекување, завршени, откажани, неуспешни','Name of the action hook that will be triggered.'=>'Име на акционата кука што ќе се активира.','Scheduled Action Columns'=>'Колони за закажани дејства','Action Scheduler is a scalable, traceable job queue for background processing large sets of actions. Action Scheduler works by triggering an action hook to run at some time in the future. Scheduled actions can also be scheduled to run on a recurring schedule.'=>'Распоредот на дејства е скалабилна, редица за работа што може да се следи за обработка на големи групи на дејства во заднина. Распоредот на дејства работи така што ќе активира кука за акција да се активира во некое време во иднина. Може да се закажат и закажани дејства да се извршуваат по периодичен распоред.','About Action Scheduler %s'=>'За Распоредувачот на дејства %s','About'=>'За','Migrated action with ID %1$d in %2$s to ID %3$d in %4$s'=>'Мигрирана акција со ID %1$d во %2$s во ID %3$d во %4$s','Migrating %d action'=>'Акцијата %d се мигрира' . "\0" . 'Мигрирање %d дејства','Action Scheduler migration in progress. The list of scheduled actions may be incomplete.'=>'Во тек е миграција на Распоредувачот на дејства. Списокот на закажани дејства можеби е нецелосен.','Unable to remove source migrated action %s'=>'Не може да се отстрани изворт на мигриранта акција %s','Version:'=>'Верзија:','If you are using X-Accel-Redirect download method along with NGINX server, make sure that you have applied settings as described in <a href=\'%s\'>Digital/Downloadable Product Handling</a> guide.'=>'Ако користите X-Accel-Redirect начин на симнување со NGINX сервер, проверете дали сте го сетирале како што е наведено во <a href=\'%s\'>Упатство за Дигитални/Симнувачки Продукти</a>.','Invalid action - must be a recurring action.'=>'Неважечка акција - мора да биде повторлива акција.','Destination logger must be configured before running a migration'=>'Дестинацијата мора да се конфигурира пред да се изврши миграција','Destination store must be configured before running a migration'=>'Продавницата за дестинации мора да се конфигурира пред да се изврши миграција','Source logger must be configured before running a migration'=>'Изворниот дневник мора да се конфигурира пред да се изврши миграција','Source store must be configured before running a migration'=>'Изворната продавница мора да се конфигурира пред да се изврши миграција','Action Scheduler has migrated data to custom tables; however, orphaned log entries exist in the WordPress Comments table. %1$s <a href="%2$s">Learn more &raquo;</a>'=>'Распоредот на дејства мигрираше податоци во приспособени табели; сепак, записите во дневникот сирачиња постојат во табелата за коментари на WordPress. %1$s <a href="%2$s">Дознајте повеќе »</a>','This data will be deleted in %s.'=>'Овие податоци ќе се избришат во %s.','MaxMind Geolocation'=>'Геолокација на MaxMind','Choose countries / regions&hellip;'=>'Изберете земји/региони…','Not required if your download directory is protected. <a href=\'%s\'>See this guide</a> for more details. Files already uploaded will not be affected.'=>'Не е потребно ако директориумот за преземање е заштитен. <a href=\'%s\'>Погледнете го ова упатство</a> за повеќе детали. Веќе поставените датотеки нема да бидат засегнати.','Append a unique string to filename for security'=>'Додадете единствена низа на името на датотеката за безбедност','Filename'=>'Име на датотека','Redirect only (Insecure)'=>'Само пренасочување (небезбедно)','Unable to detect the Action Scheduler package.'=>'Не може да се открие пакетот Распоред на дејства.','Action Scheduler package running on your site.'=>'Пакет Распоредувач на дејства работи на вашата страница.','Action Scheduler package'=>'Пакет Распоредувач на акции','Choose a country / region&hellip;'=>'Изберете земја/регион…','Fees:'=>'Такси:','Coupon(s):'=>'Купони(и):','Items Subtotal:'=>'Субвкуп на ставки:','Update country / region'=>'Ажурирајте ја земјата/регионот','WooCommerce database update done'=>'Надградбата на WooCommerce базата на податоци е звршена','WooCommerce database update in progress'=>'Надградбата на WooCommerce базата на податоци е во тек','View progress →'=>'Прикажи напредок','Shipping Country / Region'=>'Испорака Земја/Регион','Billing Country / Region'=>'Земја / регион за наплата','Country / Region'=>'Земја / регион','Select a country / region&hellip;'=>'Изберете земја/регион…','List of categories'=>'Листа на категории','Product on sale'=>'Продукт на попуст','List of categories with their product counts'=>'Листа на категории со број на продукти','You are paying for a guest order. Please continue with payment only if you recognize this order.'=>'Плаќате за нарачка од гости. Продолжете со плаќање само ако ја препознаете оваа нарачка.','Center'=>'Центар','Filter by attribute'=>'Филтрирај по атрибут','Price: high to low'=>'Цена: високо до ниско','Price: low to high'=>'Цена: ниска до висока','Latest'=>'Најнови','Popularity'=>'Популарност','Thumbnail sizes for responsive images.'=>'Големини на сликички за одговорни слики.','Thumbnail srcset for responsive images.'=>'Srcset за сликички за одговорни слики.','Thumbnail URL.'=>'URL на сликичка.','Full size image URL.'=>'URL на сликата со целосна големина.','Unique identifier for the fee within the cart.'=>'Единствен идентификатор за надоместокот во кошничката.','Button description.'=>'Опис на копче.','Button text.'=>'Текст на копчето.','Add to cart button parameters.'=>'Параметри на копчето за додавање во кошничка.','Is the product in stock?'=>'Дали продуктот е на залиха?','Is the product purchasable?'=>'Дали продуктот може да се купи?','Price amount.'=>'Износ на цената.','Price range, if applicable.'=>'Опсег на цени, доколку е применливо.','Sale product price, if applicable.'=>'Продажна цена на продуктот, доколку е применливо.','Regular product price.'=>'Редовна цена на продуктот.','Is the product on sale?'=>'Дали продуктот е на продажба?','If this attribute has term archive pages.'=>'Ако овој атрибут има архиви на термини.','How terms in this attribute are sorted by default.'=>'Како поимите во овој атрибут се стандардно подредени.','Attribute type.'=>'Тип на атрибут.','Variation attribute value.'=>'Вредност на атрибутот на варијација.','Variation attribute name.'=>'Име на атрибутот на варијација.','Chosen attributes (for variations).'=>'Избрани атрибути (за варијации).','Stock keeping unit, if applicable.'=>'Единица за чување залихи, доколку е применливо.','The cart item product or variation ID.'=>'Идентификатор на продукт или варијација на продуктот во кошничката.','Total weight (in grams) of all products in the cart.'=>'Вкупна тежина (во грамови) на сите продукти во кошничката.','True if the cart needs shipping. False for carts with only digital goods or stores with no shipping methods set-up.'=>'Точно ако на кошничката и треба испорака. Неточно за колички со само дигитални стоки или продавници без поставување методи за испорака.','List of cart items.'=>'Список на артикли од кошничката.','Number of items in the cart.'=>'Број на артикли во кошничката.','Number of objects (posts of any type) assigned to the term.'=>'Број на објекти (постови од кој било тип) доделени на терминот.','Term description.'=>'Опис на терминот.','String based identifier for the term.'=>'Идентификатор базиран на низа за терминот.','Limit result set to products with a certain average rating.'=>'Ограничете го поставениот резултат на продукти со одредена просечна оцена.','The logical relationship between attributes when filtering across multiple at once.'=>'Логичката врска помеѓу атрибутите при филтрирање на повеќекратни одеднаш.','List of attribute slug(s). If a term ID is provided, this will be ignored.'=>'Список на атрибути гол(и). Ако е обезбеден идентификатор на терминот, тоа ќе се игнорира.','List of attribute term IDs.'=>'Список на идентификатори на термини на атрибути.','Attribute taxonomy name.'=>'Име на таксономија на атрибути.','Limit result set to produc