dating to ensure they are compatible with the current version of WooCommerce. Suggestions to fix this:'=>'<strong>Вашата тема (%s) содржи застарени копии на некои датотеки со шаблони на WooCommerce.</strong> Овие датотеки можеби ќе треба да се ажурираат за да се осигура дека се компатибилни со тековната верзија на WooCommerce. Предлози за да се поправи ова:','Which product category should be exported?'=>'Која категорија на продукти треба да се извезува?','This is the attachment ID, or image URL, used for placeholder images in the product catalog. Products with no image will use this.'=>'Ова е ID на прилогот, или URL-адреса на сликата, што се користи за слики од место во каталогот на продукти. Продуктите без слика ќе го користат ова.','Enter attachment ID or URL to an image'=>'Внесете ID на прилог или URL на слика','The "%s" payment method is currently disabled'=>'Начинот на плаќање „%s“ во моментов е оневозможен','The "%s" payment method is currently enabled'=>'Начинот на плаќање „%s“ е моментално овозможен','Set up the "%s" payment method'=>'Поставете го начинот на плаќање „%s“.','Manage the "%s" payment method'=>'Управувајте со начинот на плаќање „%s“.','Move down'=>'Да се движи надолу','Move the "%s" payment method down'=>'Поместете го начинот на плаќање „%s“ надолу','Move up'=>'Движете се нагоре','Move the "%s" payment method up'=>'Поместете го начинот на плаќање „%s“ нагоре','Enter a number to set stock quantity at the variation level. Use a variation\'s \'Manage stock?\' check box above to enable/disable stock management at the variation level.'=>'Внесете број за да ја поставите количината на залиха на ниво на варијација. Користете ја варијацијата „Да се управува со акции?“ штиклирајте го полето погоре за да овозможите/оневозможите управување со акции на ниво на варијација.','Low stock amount'=>'Низок износ на акции','Set up PayPal for me using this email:'=>'Поставете PayPal за мене користејќи ја оваа е-пошта:','WooCommerce PayPal Checkout Gateway'=>'ВуCommerce PayPal Checkout Gateway','Set up Stripe for me using this email:'=>'Поставете го Stripe за мене користејќи ја оваа е-пошта:','We\'ll use %1$s for product weight and %2$s for product dimensions.'=>'Ќе користиме %1$s за тежина на продуктот и %2$s за димензии на продуктот.','ShipStation icon'=>'Икона ShipStation','We recommend using ShipStation to save time at the post office by printing your shipping labels at home. Try ShipStation free for 30 days.'=>'Препорачуваме да користите ShipStation за да заштедите време во поштата со печатење на вашите етикети за испорака дома. Пробајте ShipStation бесплатно 30 дена.','WooCommerce Services icon'=>'Икона WooCommerce Services','A live rate is the exact cost to ship an order, quoted directly from the shipping carrier.'=>'Стапката во живо е точниот трошок за испраќање нарачка, цитиран директно од превозникот.','If you\'d like to offer <span class="help_tip" data-tip="%1$s">live rates</span> from a specific carrier (e.g. UPS) you can find a variety of extensions available for WooCommerce <a href="%2$s" target="_blank">here</a>.'=>'Ако сакате да понудите <span class="help_tip" data-tip="%1$s">стапки во живо</span> од одреден оператор (на пр. UPS), можете да најдете различни екстензии достапни за WooCommerce <a href="%2$s" target="_blank">овде</a> .','We\'ve created two Shipping Zones - for %s and for the rest of the world. Below you can set Flat Rate shipping costs for these Zones or offer Free Shipping.'=>'Создадовме две зони за испорака - за %s и за остатокот од светот. Подолу можете да ги поставите трошоците за испорака со рамна стапка за овие зони или да понудите бесплатна испорака.','When handling an %s, should personal data within orders be retained or removed?'=>'Кога постапувате по %s, дали личните податоци во нарачките треба да се задржат или отстранат?','When handling an %s, should access to downloadable files be revoked and download logs cleared?'=>'Кога постапувате по %s, дали треба да се укине пристапот до датотеките што може да се преземат и да се исчистат дневниците за преземање?','Yards'=>'Јарди','Inches'=>'Инчи','Millimeters'=>'Милиметри','Centimeters'=>'Сантиметри','Meters'=>'Метри','Grams'=>'Грама','Kilograms'=>'Килограми','Alto Paraguay'=>'Горен Парагвај','Presidente Hayes'=>'Пресиденте Аиес','Amambay'=>'Амамбаи','Central'=>'Централ','Cordillera'=>'Кордилера','San Pedro'=>'Сан Педро','Ounces'=>'Унци','Pounds'=>'фунти','Item moved down'=>'Ставката е преместена надолу','Item moved up'=>'Ставката е преместена нагоре','You may need to manually restore the item\'s stock.'=>'Можеби ќе треба рачно да ги вратите залихите на ставката.','Are you sure you want to remove the selected items?'=>'Дали сте сигурни дека сакате да ги отстраните избраните ставки?','Sud Sardegna'=>'Суд Сардења','Apartment, suite, unit, etc.'=>'Стан, апартман, единица итн.','%d API key permanently revoked.'=>'%d клуч за API е трајно отповикан.' . "\0" . '%d клучеви на API се трајно отповикани.','Cannot set attributes due to invalid parent product.'=>'Не може да се постават атрибути поради неважечки матичен продукт.','This action cannot be reversed. Are you sure you wish to erase personal data from the selected orders?'=>'Оваa акција не може да се врати назад. Дали сте сигурни дека сакате да ги избришете личните податоци од избраните нарачки?','Payer last name'=>'Презиме на плаќачот','Payer first name'=>'Име на плаќачот','Billing Address'=>'Адреса за наплата','Billing Address 1'=>'Адреса за наплата 2','Payer PayPal address'=>'Адреса на PayPal на исплатувачот','MySQL version string.'=>'Низа на верзијата на MySQL.','Your CSV needs to include columns in a specific order. %1$sClick here to download a sample%2$s.'=>'Вашиот CSV треба да вклучува колони во одреден редослед. %1$sКликнете овде за да преземете примерок%2$s.','shipping packagesShipping %d'=>'Испорака %d','Shipping Address'=>'Адреса за испорака','Shipping Address 1'=>'Адреса за испорака 1','terms and conditions'=>'правила и услови','privacy policy'=>'полиса за приватност','United States (US) dollar'=>'Амерички долар','eCheck ending in %1$s'=>'е-проверка што завршува на %1$s','This will be how your name will be displayed in the account section and in reviews'=>'Вака ќе се прикаже вашето име во делот за сметки и во прегледите','If you have a coupon code, please apply it below.'=>'Доколку имате купон, аплицирајте го подолу.','PayPal allows us to send one address. If you are using PayPal for shipping labels you may prefer to send the shipping address rather than billing. Turning this option off may prevent PayPal Seller protection from applying.'=>'PayPal ни овозможува да испратиме една адреса. Ако користите PayPal за етикети за испорака, можеби претпочитате да ја испратите адресата за испорака наместо наплата. Исклучувањето на оваа опција може да спречи примена на заштитата на продавачот на PayPal.','%1$s &ndash; %2$s'=>'%1$s &ndash; %2$s','%1$s (#%2$s)'=>'%1$s (#%2$s)','Other locations'=>'Останати локации','Required'=>'Задолжително','%s page'=>'%s страница','No page set'=>'Не е поставена страница','%s field'=>'%s поле','Please see the <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">PayPal Privacy Policy</a> for more details.'=>'Ве молиме погледнете ја Политиката за <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">приватност на PayPal</a> за повеќе детали.','We accept payments through PayPal. When processing payments, some of your data will be passed to PayPal, including information required to process or support the payment, such as the purchase total and billing information.'=>'Ние прифаќаме плаќања преку PayPal. При обработката на плаќањата, некои од вашите податоци ќе бидат предадени на PayPal, вклучувајќи ги и информациите потребни за обработка или поддршка на плаќањето, како што се вкупниот износ на купувањето и информациите за наплата.','PayPal Standard redirects customers to PayPal to enter their payment information.'=>'PayPal Standard ги пренасочува клиентите кон PayPal за да ги внесат нивните информации за плаќање.','Any &quot;%1$s&quot; method'=>'Било кој метод „%1$s“.','Take payments in person via checks. This offline gateway can also be useful to test purchases.'=>'Преземете плаќања лично преку чекови. Овој офлајн портал може да биде корисен и за тестирање на купувањата.','Account details:'=>'Детали за сметка:','Take payments in person via BACS. More commonly known as direct bank/wire transfer.'=>'Земете плаќања лично преку BACS. Попознат како директен банкарски/жичен трансфер.','Comma-separated list of search stopwords in your languageabout,an,are,as,at,be,by,com,for,from,how,in,is,it,of,on,or,that,the,this,to,was,what,when,where,who,will,with,www'=>'за, еден, се, како, кај, да биде, од, ком, за, од, како, во, е, на, на, или, тоа, ова, до, било, што, кога, каде, кој,ќе,со,www','Optionally add some text for the terms checkbox that customers must accept.'=>'По избор додадете текст за полето за избор на условите што клиентите мора да ги прифатат.','Highlight required fields with an asterisk'=>'Означете ги потребните полиња со ѕвездичка','I have read and agree to the website %s'=>'Ја прочитав и се согласувам со веб-локацијата %s','These options let you change the appearance of the WooCommerce checkout.'=>'Овие опции ви дозволуваат да го промените изгледот на наплатата на WooCommerce.','In this subsection you should list which third party payment processors you’re using to take payments on your store since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>'Во оваа потсекција треба да наведете кои процесори за плаќања од трета страна ги користите за плаќања во вашата продавница бидејќи тие може да работат со податоци за клиентите. Го вклучивме PayPal како пример, но треба да го отстраните ако не користите PayPal.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'Ние споделуваме информации со трети страни кои ни помагаат да ви ги обезбедиме нашите нарачки и услуги за складирање; на пример --','In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>'Во овој дел треба да наведете со кого споделувате податоци и за која цел. Ова може да вклучува, но не може да биде ограничено на, аналитика, маркетинг, портали за плаќање, добавувачи на испорака и вградувања на трети страни.','What we share with others'=>'Што споделуваме со останатите','Our team members have access to this information to help fulfill orders, process refunds and support you.'=>'Членовите на нашиот тим имаат пристап до овие информации за да помогнат во исполнувањето на нарачките, процесот на рефундирање и поддршката за вас.','Customer information like your name, email address, and billing and shipping information.'=>'Информации за клиентите, како што се вашето име, адреса на е-пошта и информации за наплата и испорака.','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'Нарачајте информации како што е купено, кога е купено и каде треба да се испрати и','Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:'=>'Членовите на нашиот тим имаат пристап до информациите што ни ги давате. На пример, и администраторите и менаџерите на продавници можат да пристапат до:','Who on our team has access'=>'Кој од нашиот тим има пристап','We will also store comments or reviews, if you choose to leave them.'=>'Ние, исто така, ќе складираме коментари или рецензии, ако одлучите да ги оставите.','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Ние генерално ги чуваме информациите за вас онолку долго колку што ни се потребни информациите за целите за кои ги собираме и користиме и не сме законски обврзани да продолжиме да ги чуваме. На пример, ќе ги складираме информациите за нарачката за XXX години за даночни и сметководствени цели. Ова ги вклучува вашето име, адреса на е-пошта и адреси за наплата и испорака.','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Ако креирате сметка, ќе го зачуваме вашето име, адреса, е-пошта и телефонски број, кои ќе се користат за пополнување на наплатата за идни нарачки.','Send you marketing messages, if you choose to receive them'=>'Ви испраќаме маркетинг пораки, доколку одберете да ги примате','Improve our store offerings'=>'Подобрете ги понудите на нашите продавници','Comply with any legal obligations we have, such as calculating taxes'=>'Почитувајте ги сите законски обврски што ги имаме, како што се пресметување даноци','Set up your account for our store'=>'Поставете ја вашата сметка за нашата продавница','Process payments and prevent fraud'=>'Процесирајте ги плаќањата и спречите измама','Respond to your requests, including refunds and complaints'=>'Одговорете на вашите барања, вклучувајќи рефундирање и поплаки','Send you information about your account and order'=>'Ви испраќа информации за вашата сметка и нарачка','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'Кога купувате од нас, ќе побараме од вас да дадете информации вклучувајќи го вашето име, адреса за наплата, адреса за испорака, адреса на е-пошта, телефонски број, детали за кредитна картичка/плаќање и опционални информации за сметката, како што се корисничко име и лозинка. Ќе ги користиме овие информации за цели, како што се:','Note: you may want to further detail your cookie policy, and link to that section from here.'=>'Забелешка: можеби ќе сакате дополнително да ја детализирате вашата политика за колачиња и да се поврзете со тој дел од овде.','We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>'Исто така, ќе користиме колачиња за да ја следиме содржината на кошничката додека ја прелистувате нашата страница.','Shipping address: we’ll ask you to enter this so we can, for instance, estimate shipping before you place an order, and send you the order!'=>'Адреса на доставување: ќе побараме да ја внесете, за да може, на пример, да се процени трошокот на доставувањето пред да ја направите нарачката и за да ви ја пратиме нарачката!','Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping'=>'Местоположба, IP адреса и вид на прелистувач: овие ќе ги користиме за цели како проценка на даноците и доставувањето','Products you’ve viewed: we’ll use this to, for example, show you products you’ve recently viewed'=>'Продукти што сте ги прегледале: ние ќе го користиме ова за, на пример, да ви покажеме продукти што неодамна сте ги прегледале','While you visit our site, we’ll track:'=>'Додека ја посетувате нашата страница, ние ќе следиме:','What we collect and store'=>'Она што го собираме и складираме','We collect information about you during the checkout process on our store.'=>'Ние собираме информации за вас за време на процесот на наплата во нашата продавница.','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Овој примерок јазик ги вклучува основите околу тоа кои лични податоци може да ги собира, складира и споделува вашата продавница, како и кој може да има пристап до тие податоци. Во зависност од тоа кои поставки се овозможени и кои дополнителни приклучоци се користат, специфичните информации што ги споделува вашата продавница ќе варираат. Препорачуваме да се консултирате со адвокат кога одлучувате кои информации да ги откриете за вашата политика за приватност.','Token'=>'Токен','Payment Tokens'=>'Токен за плаќање','Access granted'=>'Пристапот е одобрен','Download count'=>'Број на преземања','User email'=>'Е-пошта на корисникот','Browser User Agent'=>'Browser User Agent','Order Number'=>'Број на нарачка','Items Purchased'=>'Купени продукти','optional'=>'опционално','User roleShop manager'=>'Менаџер на продавница','User roleCustomer'=>'Клиент','display name%1$s %2$s'=>'%1$s %2$s','Display name'=>'Прикажи како','Display name cannot be changed to email address due to privacy concern.'=>'Името за прикажување не може да биде адреса за е-пошта заради приватни причини.','Unable to create order.'=>'Неуспешно создавање на нарачка.','Personal data removed.'=>'Личните податоци се избришани.','Phone Number'=>'Телефонски број','Billing Postal/Zip Code'=>'Поштенски број','Billing State'=>'Област','Billing City'=>'Град','Billing Company'=>'Компанија','Billing Last Name'=>'Презиме за наплата','Billing First Name'=>'Име за наплата','Shipping State'=>'Држава на доставување','Shipping Postal/Zip Code'=>'Поштенски код на доставувањето','Cloning is forbidden.'=>'Клонирањето е забрането.','Shipping City'=>'Град на доставување','Shipping Company'=>'Деловно друштво за доставување','Unserializing instances of this class is forbidden.'=>'Забрането е десеријализирањето на инстанци на оваа класа. ','Access to Purchased Downloads'=>'Пристап до купените преземања','Purchased Downloads'=>'Купени преземања','Removed payment token "%d"'=>'Отстранет токен за плаќање „%d“','Customer download permissions have been retained.'=>'Дозволите за преземање на клиентите се задржани.','Removed access to downloadable files.'=>'Отстранет пристапот до датотеките што може да се преземат.','Personal data within order %s has been retained.'=>'Личните податоци во нарачката %s се задржани.','Removed personal data from order %s.'=>'Отстранети се личните податоци од нарачката %s.','Removed customer "%s"'=>'Отстранет клиент „%s“','%d permissions deleted'=>'Избришани се %d дозволи','This tool will delete expired download permissions and permissions with 0 remaining downloads.'=>'Оваа алатка ќе ги избрише истечените дозволи и дозволите за преземање со преостанати 0 преземања.','Clean up download permissions'=>'Исчистете ги дозволите за преземање','Used-up download permissions'=>'Искористени дозволи за преземање','Limit result set to products with a specific attribute. Use the taxonomy name/attribute slug.'=>'Ограничете го поставениот резултат на продукти со специфичен атрибут. Користете го таксономското име/атрибутот голтка.','Shipping Last Name'=>'Презиме за испорака','Shipping First Name'=>'Име за испорака','Download ID'=>'ИД за преземање','Customer Data'=>'Податоци за клиентите','Error during status transition.'=>'Грешка при преминување на статусот.','Update status event failed.'=>'Настанот за ажурирање статус не успеа.','Payment complete event failed.'=>'Настанот со целосно плаќање не успеа.','Please read and accept the terms and conditions to proceed with your order.'=>'Ве молиме прочитајте ги и прифатете ги одредбите и условите за да продолжите со вашата нарачка.','%1$s has been removed from your cart because it has since been modified. You can add it back to your cart <a href="%2$s">here</a>.'=>'%1$s е отстранета од вашата кошничка бидејќи оттогаш е изменета. Можете да го додадете назад во вашата кошничка <a href="%2$s">овде</a> .','Deleted all active sessions, and %d save