laced an order, for the specified duration. They will be deleted. Any orders will be converted into guest orders.'=>'Неактивни сметки се оние кои не се најавени или не направиле нарачка за одреденото времетраење. Тие ќе бидат избришани. Сите нарачки ќе бидат претворени во нарачки за гости.','Retain inactive accounts '=>'Задржете неактивни сметки','Choose how long to retain personal data when it\'s no longer needed for processing. Leave the following options blank to retain this data indefinitely.'=>'Изберете колку долго да ги чувате личните податоци кога веќе не се потребни за обработка. Оставете ги следните опции празни за да ги задржите овие податоци на неодредено време.','Personal data retention'=>'Задржување на лични податоци','Your personal data will be used to process your order, support your experience throughout this website, and for other purposes described in our %s.'=>'Вашите лични податоци ќе се користат за обработка на вашата нарачка, поддршка на вашето искуство низ оваа веб-локација и за други цели опишани во нашата %s.','Optionally add some text about your store privacy policy to show during checkout.'=>'По избор додадете текст за политиката за приватност на вашата продавница за да се прикаже при наплатата.','Checkout privacy policy'=>'Проверете ја политиката за приватност','Your personal data will be used to support your experience throughout this website, to manage access to your account, and for other purposes described in our %s.'=>'Вашите лични податоци ќе се користат за поддршка на вашето искуство низ оваа веб-локација, за управување со пристапот до вашата сметка и за други цели опишани во нашиот %s.','Optionally add some text about your store privacy policy to show on account registration forms.'=>'По избор додадете текст за политиката за приватност на вашата продавница за да се прикаже на формуларите за регистрација на сметката.','This section controls the display of your website privacy policy. The privacy notices below will not show up unles