yment setup'=>'подесување на плаќање','Reasons you\'ll love Jetpack'=>'Причини поради кои ќе го сакате  Jetpack','Webhook topic unknown. Please select a valid topic.'=>'Webhook непозната тема.Ве молиме изберете валидна тема.','Delete "%s" permanently'=>'Избриши "%s" перманентно','payment setup and automated taxes'=>'подесување на плаќање и автоматизирани даноци','Continue with Jetpack'=>'Продолжи со Jetpack','Email address to receive payments'=>'Email адреса за примање на плаќања','Direct payments to email address:'=>'Директно плаќање на email адреси:','Choose the payment that you want, pay now, pay later or slice it. No credit card numbers, no passwords, no worries. <a href="%s" target="_blank">Learn more about Klarna</a>.'=>'Изберете го саканото плаќање, плати сега, плати подоцна или дел. Без броеви на кредитни картички, без лозинки, без грижи. <a href="%s" target="_blank">Дознај повеќе за Кларна</a>.','Securely accept credit and debit cards with one low rate, no surprise fees (custom rates available). Sell online and in store and track sales and inventory in one place. <a href="%s" target="_blank">Learn more about Square</a>.'=>'Безбедно прифатете кредитни и дебитни картички со една ниска стапка , без изненадувачки провизии (достапни стандардни стапки). Продајте онлајн и чувајте и следете ги продажбите и инвентарот на едно место. <a href="%s" target="_blank"> Дознај повеќе за Square </a>.','Square'=>'Плоштад','Klarna Payments'=>'Плаќања на Кларна','Klarna Checkout'=>'Klarna Checkout','Full checkout experience with pay now, pay later and slice it. No credit card numbers, no passwords, no worries. <a href="%s" target="_blank">Learn more about Klarna</a>.'=>'Комплетна искуство со проверка на плати сега, плати подоцна и поделено на делови. Без броеви на кредитни картички, без лозинки, без грижи. <a href="%s" target="_blank"> Дознај повеќе за Klarna </a>.','Accept debit and credit cards in 135+ currencies, methods such as Alipay, and one-touch checkout with Apple Pay.